import React from "react";
import "./Gobackbtn.css";

const Gobackbtn = React.createClass({
  mixins: [Router.Navigation],
  render() {
    return (
      <button className="button icon-left" onClick={this.navigateBack}>
        Back
      </button>
    );
  },
  navigateBack: function() {
    this.goBack();
  }
});

export default Gobackbtn;
